import { useNavigate } from 'react-router-dom'
import { User } from '../Type/User'
import '../../css/auth.css'
import React, { useReducer, useRef } from 'react'

type Input = {
    inputLogin:string,
    inputPassword:string
}

export const Login = () =>{
    const navigate = useNavigate()

    const authorization = async () : Promise<void> => {
        const token = await getToken()
    }
    
    let vl
    const loginValue = useRef(vl)

    const getToken = async (data : User) : Promise<string> => {

        const urlLogin = 'https://localhost:7145/Jwt/Login'
        const responce = await fetch(urlLogin,{ method: 'POST',
        headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
            'body':  JSON.stringify(data)
        }})
    
        const promise = await responce.text();
        
        return promise
    }

    return (
        <div className='flex panel'>
            <h1>WebShell</h1>
            <div className='lineTop'/>
            <label>Логин</label>
            <input className = 'input' />
            <label>Пароль</label>
            <input value={vl} className = 'input' />
            <div className='lineBottom'/>
            <button className='button login' onClick={()=>{navigate('/console')}}>Отправить </button>
            <button className='button register'  onClick={() => window.location.href='http://localhost:3000/register'}>Регистрация</button>
        </div>
    );
}
